export function ListElement() {
	return (
		<li className="w-full h-1/6 pl-5 pt-5">
			<div className="w-[5%] h-4/5 border rounded-full bg-gradient-to-br from-[#57DDFF] to-[#C058F3] flex">
				<img src="../icon-check.svg" alt="check" />
			</div>
		</li>
	)
}
